import React from 'react';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <header>
        <button className="auth-button">Sign Up / Login</button>
      </header>
      <main>
        <div className="content-wrapper">
          <input type="text" className="search-bar" placeholder="How can Echo help you today?" />
          <p className="previous-research-label">Previous research</p>
          <div className="research-blocks">
            <div className="research-block">Research 1</div>
            <div className="research-block">Research 2</div>
            <div className="research-block">Research 3</div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default LandingPage;
